Si consolidano i rapporti tra Stati Uniti e Abruzzo dopo la visita dei 27 membri della NIAF (National Italian American Foundation).
Un'occasione per mostrare ai delegati, che sono imprenditori e uomini di cultura americani, le eccellenze abruzzesi l’Abruzzo.
@niaforg https://t.co/PNHK8akevm

💪Alla fine della giornata, fa piacere vedersi citati dal report giornaliero di https://t.co/la2sHfhXYH. Vuol dire che stiamo lavorando bene! 
@Azione_it @CarloCalenda @MatteoRichetti 
👇👇👇 https://t.co/7Rvaos7sPq

Renzi? Lo vedo solo in tv, non l'ho mai incontrato sui territori. 
Soprattutto, non ho mai incontrato neanche il simbolo di Italia Viva che ha preso lo 0,1%, su tutto il territorio nazionale. 

